import React, { Component } from "react";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import { Animated } from "react-animated-css";
import Toolbar from "@material-ui/core/Toolbar";

const styles = {
  header: {
    color: "#E040FB",
    fontFamily: "Righteous",
    fontWeight: "bold",
    fontSize: "5vmax",
    position: "relative",
    bottom: "70px",
    marginBottom: "5rem"
  },
  grid: {
    display: "flex",
    flexDirection: "column",
    justifyItems: "center",
    position: "relative",
    bottom: "80px"
  },
  about: {
    fontFamily: "Righteous"
  },
  text: {
    color: "#30323e",
    fontFamily: "Quicksand",
    backgroundColor: "rgba(216, 220, 242, 0.6)",
    fontWeight: "bold",
    padding: 30
  },
  home: {
    color: "#d8dcf2",
    fontSize: "2rem",
    fontFamily: "Lobster, cursive",
    textDecoration: "underline",
    textDecorationColor: "#e040fb"
  },
  body: {
    position: "relative",
    top: 100
  },
  all: {
    backgroundColor: "#212127d3",
    borderRadius: "5%",
    margin: 30
  },
  info: {
    color: "#d8dcf2",
    fontFamily: "Quicksand",
    fontWeight: "bold",
    fontSize: "3vmax",
    position: "relative",
    bottom: "100px"
  },
  picture: {
    maxWidth: "100%",
    maxHeight: "100vh",
    margin: "auto",
    position: "relative",
    bottom: 70
  },
  button: {
    position: "relative",
    top: 30,
    backgroundColor: "#e040fb",
    margin: "5rem 3rem",
    width: "20rem",
    height: "auto"
  },
  links: {
    display: "grid",
    gridTemplateColumns: "1fr",
    gridRowGap: "4rem",
    justifyItems: "center",
    marginBottom: "3rem"
  },
  link: {
    position: "relative",
    bottom: 40
  },
  urls: {
    fontFamily: "Righteous",
    color: "#d8dcf2",
    fontSize: "3rem",
    marginTop: "6rem"
  }
};

class NeowsResult extends Component {
  render() {
    const { classes } = this.props;

    return (
      <React.Fragment>
        <Toolbar>
          <Animated
            animationIn="fadeInRight"
            animationOut="fadeOut"
            isVisible={true}
          >
            <Button className={classes.home} href="/">
              Universa Localis
            </Button>
          </Animated>
        </Toolbar>
        <div className={classes.all}>
          <div className={classes.body}>
            <div>
              <h1 className={classes.header}>The Star Map</h1>
            </div>
            <div className={classes.grid}>
              <iframe
                title="skymap"
                src="http://server1.sky-map.org/skywindow?object=sirius"
                width="800"
                height="640"
              />
            </div>
            <Button
              className={classes.button}
              variant="contained"
              color="primary"
              style={{ marginBottom: 70 }}
              href="/"
            >
              Go Back
            </Button>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default withStyles(styles)(NeowsResult);
